INSERT INTO `content` (`id`, `title`, `image`, `text`, `link`) VALUES
(29, '3G E-learning', '3d elerning.jpg', '3G E-learning LLC is a leading independent publisher specializing in developing collections of titles in various subjects areas such as Agriculture and Life Sciences, Animal and Veterinary Science, Business and Management, General Science, Computer Science, Physical Education, Social Sciences, Careers, Women Empowerment, Hotel and Restaurant Management. With over 500 active titles, we offer high quality content to stutdents with a focus on first-class production.', 'https://web.quezoncitypubliclibrary.org/mainportal/Eresources/3G.html'),
(32, 'EBSCO', 'EBSCO.jpg', 'EBSCO Information Services a Library resource company in the academic, medical, K–12, public library, law, corporate, and government markets', 'https://www.ebsco.com/'),
(33, 'Phil E-journals', 'Phil E-journals.jpg', 'The Philippine E-Journals is an expanding collection of academic journals that are made accessible globally through a single Web-based platform. It is hosted by C&E Publishing, Inc., a premier educational publisher in the Philippines and a leader in the distribution of integrated information-based solutions.', 'https://ejournals.ph/journals.php'),
(34, 'Emerald Publishing', 'Emerald Publishing.jpg', 'Emerald Publishing is one of the world\'s leading digital first publishers, commissioning, curating and showcasing research that can make a real difference. We work with thousands of universities and business schools across the world to share knowledge and provoke the kind of debate that leads to positive change. We are a family business passionate about people and doing things differently.', 'https://www.emerald.com/insight/'),
(35, 'Springer Link', 'Springer Link.jpg', 'Providing researchers with access to millions of scientific documents from journals, books, series, protocols, reference works and proceedings.', 'https://link.springer.com/'),
(37, 'Google', 'g.jpg', 'search for information about (someone or something) on the internet using the search engine Google:', 'https://www.google.com/'),
(39, 'WILEY', 'Wiley_black.jpg', 'We’re a global leader in research and education. From a print shop in New York City to a global and digital presence, we’ve spent more than 200 years developing and fueling the world’s knowledge ecosystem. Today, our high-impact content, platforms, and services help researchers, learners, institutions, and corporations achieve their goals in an ever-changing world.', 'https://wileysgp.ipublishcentral.net/institution-library'),
(40, 'Gale', 'Gale.jpg', 'Browse all Gale research products available from your library. (30 days free trial)', 'https://link.gale.com/apps/menu?u=phqcpl');
INSERT INTO `digital` (`id`, `title`, `image`, `text`, `link`) VALUES
(71, 'OPAC', 'a.jpg', 'Quezon City Public Library\'s Online Public Access Catalog or OPAC is an online database of collection held by the library. It is used to locate the physical materials such as books, thesis, maps, discs and kits in different branches and sections of the library. It also provides access to electronic books and downloadable graphic materials.', 'https://quezoncitypubliclibrary.sparksoft-apps.com/?fbclid=IwAR0x2Fn5MBQ1DUh1D4ah3IEHrjN-3BIyy9kVeT6ywzcrANpxZhQ-KwOSSok'),
(72, 'PressReader', '10', 'PressReader is an international digital newsstand that lets you read over 7,000 of the world’s leading newspapers and magazines from more than 100 countries. These include international', 'https://www.pressreader.com/catalog'),
(74, '3G E-learning', '1.jpg', '3G E-learning LLC is a leading independent publisher specializing in developing collections of titles in various subjects areas such as Agriculture and Life Sciences, Animal and Veterinary Science, Business and Management, General Science, Computer Science, Physical Education, Social Sciences, Careers, Women Empowerment, Hotel and Restaurant Management. With over 500 active titles, we offer high quality content to stutdents with a focus on first-class production.', 'https://web.quezoncitypubliclibrary.org/mainportal/Eresources/3G.html'),
(75, 'World Book Online', '2.png', 'World Book Online is an online information and educational service provided by World Book consisting of information, services and content (as defined in Section 7) provided by World Book, affiliates of World Book, and third parties.', 'https://web.quezoncitypubliclibrary.org/mainportal/Eresources/worldbook.html'),
(76, 'BuriBooks', '12', 'BuriBooks is the largest ebook library of Filipino children\'s books readily available to the public.', 'https://web.buribooks.com/login'),
(77, 'Encleare', 'encleara.jpg', 'General Education Advancement Program. GEAP English, Mathematics, Science and Social Studies. ', 'https://encleare.com/'),
(78, 'Gale', '9.jpg', 'Gale offers a variety of resources for education, lifelong learning, and academic research.', 'https://link.gale.com/apps/menu?u=phqcpl&fbclid=IwAR1d0xpQson8TOjmp3M_UjOz25J6I5dRXiBCW7Ds5a5CTChj_XXGsHQDVew'),
(79, 'MyLegalWhiz', 'legalwhiz.jpg', 'With MyLegalWhiz, libraries can now opt to allow easy and unimpeded access to organized and dynamic content for their students.', 'https://web.quezoncitypubliclibrary.org/mainportal/DigitalLib/mylegalwhiz.html'),
(177, 'eSCRA', '141.jpg', 'The Official eSCRA Library.Complete Decisions from 1901 to the Present.Online Library, Always Updated and Available.Search and Browse Modes Makes it Fast and Intuitive.TrueCite Technology gives you the same look and feel as the book.', 'https://www.central.com.ph/escra/signIn/'),
(178, 'The lawphil project', '2.jfif', 'Realising the essence of making the law accessible and understandable not only to the legal community but to all sectors of society, arellano law foundation has embarked to digitize and make available through the internet all philippine laws, statutes, jurisprudence, presidential decrees, issuances, executive orders, administrative orders.', 'https://www.lawphil.net/'),
(179, 'Chanrobles', '3.jfif', 'Chan robles was founded on may 28, 1988. It was then known as joselito guianan chan & associates based in manila. In 1991, atty. Joselito guianan chan was joined by atty. Reynaldo bustos robles to form chan robles. Both partners are active, experienced practitioners, authors and publishers of law books, professors of law and professional consultants .', 'https://www.chanrobles.com/'),
(180, 'QCLIBROS', 'b.jpg', 'Quezon City Library Repository Online System (QC LIBROS)\n\nProvides free access to scanned copies of the full text of QC Local History Collections, News Articles, QC Ordinances and Resolutions, and other laws.', 'http://libros.quezoncitypubliclibrary.org:8080/jspui/'),
(181, 'Big Timber Media', '3.jpg', 'Big Timber Media General Information Description. Provider of digital platform services intending to support publishers and distributors in providing their eBooks to school-age readers.', 'https://web.quezoncitypubliclibrary.org/mainportal/Eresources/bigtimbermedia.html'),
(182, 'NLP eResources', 'nlp.jpg', 'Gateway access to NLP eResources', 'https://eportal.nlp.gov.ph/eresources');
