INSERT INTO `fil` (`id`, `title`, `image`, `text`, `link`) VALUES
(8, 'OPAC', 'opac.jpg', 'Quezon City Public Library\'s Online Public Access Catalog or OPAC is an online database of collection held by the library. It is used to locate the physical materials such as books, thesis, maps, discs and kits in different branches and sections of the library. It also provides access to electronic books and downloadable graphic materials.', 'https://quezoncitypubliclibrary.sparksoft-apps.com/?fbclid=IwAR0x2Fn5MBQ1DUh1D4ah3IEHrjN-3BIyy9kVeT6ywzcrANpxZhQ-KwOSSok'),
(10, 'STARBOOKS', 'starbooks online.jpg', 'The S&T Academic and Research-Based Openly-Operated Kiosk Stations (STARBOOKS) will be access portals in key areas in the Philippines where residents can have access to the scientific information physically available at DOST (SciNeT), Philippine eLib project sources, freely-available online resources, and subscribed databases (if any).', 'https://www.starbooks.ph/login'),
(11, 'QCLIBROS', 'libros.jpg', 'QC LIBROS DSPACE PRESERVES AND ENABLES EASY AND OPEN ACCESS TO ALL TYPES OF DIGITAL CONTENT INCLUDING TEXT, IMAGES, MOVING IMAGES, MPEGS AND DATA SETS', 'http://10.27.0.12:8080/jspui');
INSERT INTO `law` (`id`, `title`, `image`, `text`, `link`) VALUES
(15, 'GOOGLE', 'g.jpg', 'SEARCH FOR INFORMATION ABOUT (SOMEONE OR SOMETHING) ON THE INTERNET USING THE SEARCH ENGINE GOOGLE:', 'https://www.google.com/'),
(16, 'OPAC', 'opac.jpg', 'QUEZON CITY PUBLIC LIBRARY ONLINE PUBLIC ACCESS CATALOG OR OPAC IS AN ONLINE DATABASE OF COLLECTION HELD BY THE LIBRARY. ', 'https://quezoncitypubliclibrary.sparksoft-apps.com/?fbclid=IwAR0x2Fn5MBQ1DUh1D4ah3IEHrjN-3BIyy9kVeT6ywzcrANpxZhQ-KwOSSok'),
(17, 'QCLIBROS', 'libros.jpg', 'QC LIBROS DSPACE PRESERVES AND ENABLES EASY AND OPEN ACCESS TO ALL TYPES OF DIGITAL CONTENT INCLUDING TEXT, IMAGES, MOVING IMAGES, MPEGS AND DATA SETS.', 'http://10.27.0.12:8080/jspui'),
(18, 'LAW RESEARCH BLOG', 'Capture.jfif', 'A BLOG ABOUT QUEZON CITY ORDINANCES, SUPREME COURT DECISIONS AND OTHER LAWS IN THE PHILIPPINES.\r\n', 'http://qcpl-lawresearch-center.blogspot.com/'),
(19, 'THE LAWPHIL PROJECT', 'the lawphil.jfif', 'REALISING THE ESSENCE OF MAKING THE LAW ACCESSIBLE AND UNDERSTANDABLE NOT ONLY TO THE LEGAL COMMUNITY BUT TO ALL SECTORS OF SOCIETY, ARELLANO LAW FOUNDATION HAS EMBARKED TO DIGITIZE AND MAKE AVAILABLE THROUGH THE INTERNET ALL PHILIPPINE LAWS, \r\nSTATUTES, JURISPRUDENCE, PRESIDENTIAL DECREES, ISSUANCES, EXECUTIVE ORDERS, ADMINISTRATIVE ORDERS, AND OTHER LEGAL MATERIALS.', 'https://www.lawphil.net/'),
(20, 'CHANROBLES', 'chan.jfif', 'CHAN ROBLES WAS FOUNDED ON MAY 28, 1988. \r\nIT WAS THEN KNOWN AS JOSELITO GUIANAN CHAN & ASSOCIATES BASED IN MANILA. IN 1991, ATTY. JOSELITO GUIANAN CHAN WAS JOINED BY ATTY. REYNALDO BUSTOS ROBLES TO FORM CHAN ROBLES. BOTH PARTNERS ARE ACTIVE, EXPERIENCED PRACTITIONERS, AUTHORS AND PUBLISHERS OF LAW BOOKS, PROFESSORS OF LAW AND PROFESSIONAL CONSULTANTS IN VARIOUS FIELDS OF LAW.', 'https://www.chanrobles.com/'),
(21, 'eSCRA', 'escrabanner2022_2.jpg', 'The Official eSCRA Library.Complete Decisions from 1901 to the Present.Online Library, Always Updated and Available.Search and Browse Modes Makes it Fast and Intuitive.TrueCite Technology gives you the same look and feel as the book.\r\n', 'https://www.central.com.ph/escra/signIn/'),
(31, 'CDAsia Online', 'cdasia.png', 'CD Technologies Asia, Inc. (CD Asia) has been setting the standard in electronic legal research in the Philippines since it was established in 1994.', 'https://web.quezoncitypubliclibrary.org/mainportal/Law/CDAsia.html'),
(32, 'MyLegalWhiz', 'legalwhiz.jpg', 'With MyLegalWhiz, libraries can now opt to allow easy and unimpeded access to organized and dynamic content for their students.', 'https://web.quezoncitypubliclibrary.org/mainportal/DigitalLib/mylegalwhiz.html');
INSERT INTO `law2` (`id`, `title`, `image`, `text`, `link`) VALUES
(1, 'CDASIA', 'cdasia.png', 'CD Technologies Asia, Inc. (CD Asia) has been setting the standard in electronic \r\nlegal research in the Philippines since it was established in 1994. For close to 3 \r\ndecades, it has been the pioneer and market leader in creating and publishing tools \r\nthat have transformed the way legal research is done in the Philippines.', 'http://10.27.255.98/eresources/Law2/CDAsia.html'),
(2, 'Google', 'google.jpg', 'SEARCH FOR INFORMATION ABOUT (SOMEONE OR SOMETHING) ON THE INTERNET USING THE SEARCH ENGINE GOOGLE:', 'https://www.google.com/'),
(3, 'Opac', 'opac.jpg', 'QUEZON CITY PUBLIC LIBRARY ONLINE PUBLIC ACCESS CATALOG OR OPAC IS AN ONLINE DATABASE OF COLLECTION HELD BY THE LIBRARY.', 'https://quezoncitypubliclibrary.sparksoft-apps.com/?fbclid=IwAR0x2Fn5MBQ1DUh1D4ah3IEHrjN-3BIyy9kVeT6ywzcrANpxZhQ-KwOSSok'),
(4, 'QCLIBROS', 'libros.jpg', 'QC LIBROS DSPACE PRESERVES AND ENABLES EASY AND OPEN ACCESS TO ALL TYPES OF DIGITAL CONTENT INCLUDING TEXT, IMAGES, MOVING IMAGES, MPEGS AND DATA SETS.\r\n', 'http://10.27.0.12:8080/jspui'),
(5, 'LAW BLOG', 'Capture.jfif', 'A BLOG ABOUT QUEZON CITY ORDINANCES, SUPREME COURT DECISIONS AND OTHER LAWS IN THE PHILIPPINES.	\r\n', 'http://qcpl-lawresearch-center.blogspot.com/'),
(6, 'The LawPhil', 'the lawphil.jfif', 'REALISING THE ESSENCE OF MAKING THE LAW ACCESSIBLE AND UNDERSTANDABLE NOT ONLY TO THE LEGAL COMMUNITY BUT TO ALL SECTORS OF SOCIETY, ARELLANO LAW FOUNDATION HAS EMBARKED TO DIGITIZE AND MAKE AVAILABLE THROUGH THE INTERNET ALL PHILIPPINE LAWS, STATUTES, JURISPRUDENCE, PRESIDENTIAL DECREES, ISSUANCES, EXECUTIVE ORDERS, ADMINISTRATIVE ORDERS, AND OTHER LEGAL MATERIALS.\r\n', 'https://www.lawphil.net/'),
(7, 'CHAN ROBLES', 'chan.jfif', 'CHAN ROBLES WAS FOUNDED ON MAY 28, 1988. IT WAS THEN KNOWN AS JOSELITO GUIANAN CHAN & ASSOCIATES BASED IN MANILA. IN 1991, ATTY. \nJOSELITO GUIANAN CHAN WAS JOINED BY ATTY. REYNALDO BUSTOS ROBLES TO FORM CHAN ROBLES. BOTH PARTNERS ARE ACTIVE, EXPERIENCED PRACTITIONERS, AUTHORS AND PUBLISHERS OF LAW BOOKS, PROFESSORS OF LAW AND PROFESSIONAL CONSULTANTS IN VARIOUS FIELDS OF LAW.\n', 'https://www.chanrobles.com/'),
(8, 'eSCRA', 'escrabanner2022_2.jpg', 'The Official eSCRA Library.Complete Decisions from 1901 to the Present.Online Library, Always Updated and Available.Search and Browse Modes Makes it Fast and Intuitive.TrueCite Technology gives you the same look and feel as the book. ', 'https://www.central.com.ph/escra/signIn/');
